@SALOMONDRIN - FIND ME ON ALL SOCIAL MEDIA. 

I'm not a rational car collector. I am fortunate enough to be able to buy a car or two that I thought I would never be able to afford. I remember all the questions I had about cars, the car world, and specially wondered “how would it feel to own one of these?”. Today I’m here to share all those answers with the people that are out there like me, while also making a dirty joke or two!

I work in the dairy industry, technology world in several areas, commercial real estate, entertainment in many levels, and do random small investments/work for others. Most of what allowed me to buy these cars is Real Estate. I’m not gonna teach you how to do what I do, I’m not going to invest in your business or idea, I’m here to simply talk about cars and titties!
